public class InnerClusterJobFlowInstancesConfigFactory(Action<Humidifier.EMR.ClusterTypes.JobFlowInstancesConfig> factoryAction = null) : SubResourceFactory<Humidifier.EMR.ClusterTypes.JobFlowInstancesConfig>
{

    internal InnerClusterInstanceFleetConfigFactory CoreInstanceFleetFactory { get; set; }

    internal InnerClusterInstanceGroupConfigFactory CoreInstanceGroupFactory { get; set; }

    internal InnerClusterInstanceFleetConfigFactory MasterInstanceFleetFactory { get; set; }

    internal InnerClusterInstanceGroupConfigFactory MasterInstanceGroupFactory { get; set; }

    internal InnerClusterPlacementTypeFactory PlacementFactory { get; set; }

    protected override Humidifier.EMR.ClusterTypes.JobFlowInstancesConfig Create()
    {
        var jobFlowInstancesConfigResult = CreateJobFlowInstancesConfig();
        factoryAction?.Invoke(jobFlowInstancesConfigResult);

        return jobFlowInstancesConfigResult;
    }

    private Humidifier.EMR.ClusterTypes.JobFlowInstancesConfig CreateJobFlowInstancesConfig()
    {
        var jobFlowInstancesConfigResult = new Humidifier.EMR.ClusterTypes.JobFlowInstancesConfig();

        return jobFlowInstancesConfigResult;
    }
    public override void CreateChildren(Humidifier.EMR.ClusterTypes.JobFlowInstancesConfig result)
    {
        base.CreateChildren(result);

        result.CoreInstanceFleet ??= CoreInstanceFleetFactory?.Build();
        result.CoreInstanceGroup ??= CoreInstanceGroupFactory?.Build();
        result.MasterInstanceFleet ??= MasterInstanceFleetFactory?.Build();
        result.MasterInstanceGroup ??= MasterInstanceGroupFactory?.Build();
        result.Placement ??= PlacementFactory?.Build();
    }

} // End Of Class

